import React, { useContext } from "react";
import Foodcontext from "../../context/foodContext";

const Header = () => {
  const foodcontext = useContext(Foodcontext);
  return (
    <div>
      <h1>Perfect Plate</h1>
    </div>
  );
};

export default Header;
